import React from 'react';
import Header from './components/header.jsx';
import Footer from './components/footer.jsx';

const contentful = require('contentful');
const client = contentful.createClient({
  space: '9ulwy6m5jpxs',
  accessToken: '2fsQuk07Wtt-7WkWKul0SjHwPBTQp4frPW70aqKFoGo',
});

function Blog() {
  console.log("blog"+Date.now());

  // entries.map(entry => {
  //   console.log(entry);
  // })
  return (
    <main className="container">
      Blog
      {client.getEntries().then(entries => {
        console.log(entries);
        entries.items.map(entry => {
          console.log(<h3>{entry.fields.title}</h3>);
          console.log(<p>{entry.fields.message.content[0].content[0].value}</p>);
          <div> Test </div>
        })
      })}
    </main>
  );
}

export default Blog;
